    false,nt"url": null,nt"notes": "This report covers the waterbird populations
    and wetland habitats at Goose Lake study site during 1979. The Special Studies section
    of the U. S. Fish and Wildlife Service conducted investigations in the large lake
    regime near Teshekpuk Lake in the National Petroleum Reserve-Alaska, each summer
    from 1977 through 1979, to aid in assessment of bird populations and of habitat
    used by water birds. This report summarizes results from the 1979 field season.",nt"license_title":
